import { Col, Container, Row } from "react-bootstrap";
import Carousel from "react-multi-carousel";
import "react-multi-carousel/lib/styles.css";
import colorsharp from "../library/img/color-sharp.png"
import htmlLogo from "../library/img/html-5-svgrepo-com-2-2.svg"
import cssLogo from "../library/img/css-3-svgrepo-com.svg"
import javascriptLogo from "../library/img/javascript-svgrepo-com.svg"
import PythonLogo from "../library/img/python-svgrepo-com.svg"
import cPlus from "../library/img/c-plus-plus-svgrepo-com.svg"
import BootstrapLogo from "../library/img/bootstrap-4-logo-svgrepo-com.svg"
import reactLogo from "../library/img/reactjs-svgrepo-com.svg"


export const Skills = () => {
    const responsive = {
        superLargeDesktop: {
          // the naming can be any, depends on you.
          breakpoint: { max: 4000, min: 3000 },
          items: 5
        },
        desktop: {
          breakpoint: { max: 3000, min: 1024 },
          items: 3
        },
        tablet: {
          breakpoint: { max: 1024, min: 464 },
          items: 2
        },
        mobile: {
          breakpoint: { max: 464, min: 0 },
          items: 1
        }
    };

    return (
        <section className="skill" id="skills">
            <Container>
                <Row>
                    <Col>
                        <div className="skill-bx">
                            <h2>
                                Skills
                            </h2>
                            <p>
                                Write a pragraph
                            </p>

                            <Carousel responsive={responsive} infinite={true} className="Skill-slider">
                                <div className="item">
                                    <img src={javascriptLogo} alt='html logo' style={{ width: 'auto', height: '25%' }}/>
                                    <h5>Web Devolpment</h5>
                                </div>
                                <div className="item">
                                    <img src={PythonLogo} alt='python logo' style={{ width: 'auto', height: '25%' }}/>
                                    <h5>Web Devolpment</h5>
                                </div>
                                {/* <div className="item">
                                    <img src={cPlus} alt='C++ logo' style={{ width: 'auto', height: '25%' }}/>
                                    <h5>Web Devolpment</h5>
                                </div> */}
                            </Carousel>
                        </div>
                    </Col>
                </Row>
            </Container>
            <img className="background-image-left" src={colorsharp} />
        </section>
    )
}
